function Aulas() {
   const onDoubleClick = (e) => {
      let appear = false;
         {e ? appear = !appear : console.log('ok')}
         console.log(appear)
      }
  return (

      <button className = "Aulas" type="check" onDoubleClick={onDoubleClick}>
      Aulas
      </button>
  );
}

export default Aulas;
